import React, { Component } from 'react';
import '../App.css';
import { Container, Row, Col, UncontrolledTooltip } from 'reactstrap';
import TableHeader from './TableHeader';
import WarmupA from './WarmupA';
import WarmupB from './WarmupB';
import WarmupC from './WarmupC';

class CycleA extends Component {
    render() {
        let weight = this.props.weight;
        let bar = this.props.bar;
        function round(num) {
            return Math.round(num*2)/2;
        }
        let res = (round(weight*65/100)).toFixed(1)-bar

        return (
            <div className='Cycle'>
                <Container className='Table'>
                    <TableHeader />
                    <WarmupA isToggle={this.props.isToggle} weight={weight}/>
                    <WarmupB isToggle={this.props.isToggle} weight={weight}/>
                    <WarmupC isToggle={this.props.isToggle} weight={weight}/>
                    <Row className="row">
                        <Col>1</Col>
                        <Col>65</Col>
                        <Col>5</Col>
                        <Col>{(round(weight*65/100)).toFixed(1)}</Col>
                    </Row>
                    <Row className="row">
                        <Col>2</Col>
                        <Col>75</Col>
                        <Col>5</Col>
                        <Col>{(round(weight*75/100)).toFixed(1)}</Col>
                    </Row>
                    <Row className="row">
                        <Col>3</Col>
                        <Col>85</Col>
                        <Col>
                            <span style={{textDecoration: "underline"}} href="#" id="tooltipA">5+</span>
                            <UncontrolledTooltip placement="bottom" target="tooltipA">As many as you can</UncontrolledTooltip>
                        </Col>
                        <Col>{(round(weight*85/100)).toFixed(1)}</Col>
                    </Row>
                </Container>
            </div>
            )
    }
}

export default CycleA;
